import React from 'react';
import { Link } from 'react-router-dom';

const Sidebar = () => {
    return (
        <div className="sidebar">
            <Link to="/home">
                <img src={`${process.env.PUBLIC_URL}/icons/home-icon.png`} alt="Home" />
            </Link>
            <Link to="/inbox">
                <img src={`${process.env.PUBLIC_URL}/icons/inbox-icon.png`} alt="Inbox" />
            </Link>
            <Link to="/sent">
                <img src={`${process.env.PUBLIC_URL}/icons/sent-icon.png`} alt="Sent" />
            </Link>
            <Link to="/drafts">
                <img src={`${process.env.PUBLIC_URL}/icons/drafts-icon.png`} alt="Drafts" />
            </Link>
            <Link to="/trash">
                <img src={`${process.env.PUBLIC_URL}/icons/trash-icon.png`} alt="Trash" />
            </Link>
            {/* Add more links as needed */}
        </div>
    );
};

export default Sidebar;
